(3, 1622575623, 1622575623, 'new', 'wfPluginUpgrade', 50, '7eae79fd5d8a0832497fd1d4c18cbb50', '7eae79fd5d8a0832497fd1d4c18cbb50', 'The Plugin \"Elementor\" needs an upgrade (3.2.3 -> 3.2.4).', 'You need to upgrade \"Elementor\" to the newest version to ensure you have any security fixes the developer has released.', 'a:19:{s:22:\"Elementor tested up to\";s:0:\"\";s:4:\"Name\";s:9:\"Elementor\";s:9:\"PluginURI\";s:97:\"https://elementor.com/?utm_source=wp-plugins&#038;utm_campaign=plugin-uri&#038;utm_medium=wp-dash\";s:7:\"Version\";s:5:\"3.2.3\";s:11:\"Description\";s:366:\"Le constructeur de sites web Elementor a tout pour plaire : constructeur de page par glisser-déposer, conception parfaite au pixel près, modification adaptée au mobile, et bien plus encore. Commencez dès maintenant ! <cite>par <a href=\"https://elementor.com/?utm_source=wp-plugins&#038;utm_campaign=author-uri&#038;utm_medium=wp-dash\">Elementor.com</a>.</cite>\";s:6:\"Author\";s:125:\"<a href=\"https://elementor.com/?utm_source=wp-plugins&#038;utm_campaign=author-uri&#038;utm_medium=wp-dash\">Elementor.com</a>\";s:9:\"AuthorURI\";s:97:\"https://elementor.com/?utm_source=wp-plugins&#038;utm_campaign=author-uri&#038;utm_medium=wp-dash\";s:10:\"TextDomain\";s:9:\"elementor\";s:10:\"DomainPath\";s:0:\"\";s:7:\"Network\";b:0;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\";s:5:\"Title\";s:121:\"<a href=\"https://elementor.com/?utm_source=wp-plugins&#038;utm_campaign=plugin-uri&#038;utm_medium=wp-dash\">Elementor</a>\";s:10:\"AuthorName\";s:13:\"Elementor.com\";s:10:\"pluginFile\";s:90:\"C:/wamp64/www/Simplon/Wordpress/18.05.wordpress/wp-content/plugins/elementor/elementor.php\";s:10:\"newVersion\";s:5:\"3.2.4\";s:4:\"slug\";s:9:\"elementor\";s:5:\"wpURL\";s:39:\"https://wordpress.org/plugins/elementor\";s:10:\"vulnerable\";b:0;}'),
(4, 1622575623, 1622575623, 'new', 'wfPluginUpgrade', 50, '2abf2087cd0adeb15ca469282231b303', '2abf2087cd0adeb15ca469282231b303', 'The Plugin \"Yoast SEO\" needs an upgrade (16.3 -> 16.4).', 'You need to upgrade \"Yoast SEO\" to the newest version to ensure you have any security fixes the developer has released.', 'a:19:{s:22:\"Elementor tested up to\";s:0:\"\";s:4:\"Name\";s:9:\"Yoast SEO\";s:9:\"PluginURI\";s:18:\"https://yoa.st/1uj\";s:7:\"Version\";s:4:\"16.3\";s:11:\"Description\";s:208:\"La première solution SEO tout-en-un pour WordPress, y compris l’analyse des pages de contenu, les plans de site XML et bien plus encore. <cite>par <a href=\"https://yoa.st/1uk\">L’équipe Yoast</a>.</cite>\";s:6:\"Author\";s:50:\"<a href=\"https://yoa.st/1uk\">L’équipe Yoast</a>\";s:9:\"AuthorURI\";s:18:\"https://yoa.st/1uk\";s:10:\"TextDomain\";s:13:\"wordpress-seo\";s:10:\"DomainPath\";s:11:\"/languages/\";s:7:\"Network\";b:0;s:10:\"RequiresWP\";s:3:\"5.6\";s:11:\"RequiresPHP\";s:6:\"5.6.20\";s:5:\"Title\";s:42:\"<a href=\"https://yoa.st/1uj\">Yoast SEO</a>\";s:10:\"AuthorName\";s:17:\"L’équipe Yoast\";s:10:\"pluginFile\";s:91:\"C:/wamp64/www/Simplon/Wordpress/18.05.wordpress/wp-content/plugins/wordpress-seo/wp-seo.php\";s:10:\"newVersion\";s:4:\"16.4\";s:4:\"slug\";s:13:\"wordpress-seo\";s:5:\"wpURL\";s:43:\"https://wordpress.org/plugins/wordpress-seo\";s:10:\"vulnerable\";b:0;}');
